<?phpnamespace Nemundo\Content\App\Contact\Install;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\App\WebService\Setup\ServiceRequestSetup;use Nemundo\Content\App\Contact\Application\ContactApplication;use Nemundo\Content\App\Contact\Content\Contact\ContactType;use Nemundo\Content\App\Contact\Content\Email\EmailType;use Nemundo\Content\App\Contact\Content\Phone\PhoneType;use Nemundo\Content\App\Contact\Data\ContactModelCollection;use Nemundo\Content\App\Contact\Script\ContactCleanScript;use Nemundo\Content\App\Contact\Service\ContactPostService;use Nemundo\Content\App\Contact\Service\EmailPostService;use Nemundo\Content\App\Contact\Service\PhonePostService;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Model\Setup\ModelCollectionSetup;class ContactInstall extends AbstractInstall{    public function install()    {        (new ModelCollectionSetup())            ->addCollection(new ContactModelCollection());        (new ContentTypeSetup(new ContactApplication()))            ->addContentType(new PhoneType())            ->addContentType(new EmailType())            ->addContentType(new ContactType());        (new ScriptSetup(new ContactApplication()))            ->addScript(new ContactCleanScript());        (new ServiceRequestSetup(new ContactApplication()))            ->addService(new ContactPostService())            ->addService(new PhonePostService())            ->addService(new EmailPostService())        ;    }}